df2['overview'].head(5)

"""Everyone among you who has even a passing familiarity with text processing is aware that each overview's word vector has to be converted. For each overview, we will now compute the Term Frequency-Inverse Document Frequency (TF-IDF) vectors.

If you're wondering what term frequency is, it's the proportion of times a word appears in a text over all occurrences, which is expressed as (term instances/total instances). The relative count of documents that contain a word is known as the "inverse document frequency," and it is expressed as log(number of documents/documents with term). Each word's total significance to the papers in which it appears is equal to TF. * IDF

This will provide you with a matrix where each row, as before, represents a movie and each column, as before, represents a word from the overview vocabulary (all the terms that appear in at least one document).This is done in order to lessen the weight given to terms that often appear in plot summaries and, as a result, their significance in determining the final similarity score.

The good news is that scikit-learn has a TfIdfVectorizer class that generates the TF-IDF matrix in a few lines. Isn't it fantastic?
"""

#Import TfIdfVectorizer from scikit-learn
from sklearn.feature_extraction.text import TfidfVectorizer

#Define a TF-IDF Vectorizer Object. Remove all english stop words such as 'the', 'a'
tfidf = TfidfVectorizer(stop_words='english')

#Replace NaN with an empty string
df2['overview'] = df2['overview'].fillna('')

#Construct the required TF-IDF matrix by fitting and transforming the data
tfidf_matrix = tfidf.fit_transform(df2['overview'])

#Output the shape of tfidf_matrix
tfidf_matrix.shape

"""We see that over 20,000 different words were used to describe the 4800 movies in our dataset.

With this matrix in hand, we can now compute a similarity score. There are several candidates for this; such as the euclidean, the Pearson and the cosine similarity scores. There is no right answer to which score is the best. Different scores work well in different scenarios and it is often a good idea to experiment with different metrics.

We will be using the cosine similarity to calculate a numeric quantity that denotes the similarity between two movies. We use the cosine similarity score since it is independent of magnitude and is relatively easy and fast to calculate. Mathematically, it is defined as follows:
![FORMULA.png](data:image/png;base64,)

Since the TF-IDF vectorizer was employed, calculating the dot product will immediately provide us with the cosine similarity score. Because it is quicker, we will utilize sklearn's linear_kernel() instead of cosine_similarities().

"""

# Import linear_kernel
from sklearn.metrics.pairwise import linear_kernel

# Compute the cosine similarity matrix
cosine_sim = linear_kernel(tfidf_matrix, tfidf_matrix)

"""We are going to define a function that takes in a movie title as an input and outputs a list of the 10 most similar movies. Firstly, for this, we need a reverse mapping of movie titles and DataFrame indices. In other words, we need a mechanism to identify the index of a movie in our metadata DataFrame, given its title."""

#Construct a reverse map of indices and movie titles
indices = pd.Series(df2.index, index=df2['title']).drop_duplicates()

"""We can now define our recommendation function because we are in a good position. The stages we'll take are as follows:

Obtain the movie's index using the title as a guide.
Get a list of the cosine similarity scores between that movie and all other movies. Make it into a list of tuples with the location as the first member and the similarity score as the second.
The second part is to order the aforementioned list of tuples according to the similarity scores.
Obtain the top ten items on this list. Ignore the first component as it is self-referential (the film that is most similar to a certain film is the film itself).
Send back the titles for the top items' matching indices.
"""

# Function that takes in movie title as input and outputs most similar movies
def get_recommendations(title, cosine_sim=cosine_sim):
    # Get the index of the movie that matches the title
    idx = indices[title]

    # Get the pairwsie similarity scores of all movies with that movie
    sim_scores = list(enumerate(cosine_sim[idx]))

    # Sort the movies based on the similarity scores
    sim_scores = sorted(sim_scores, key=lambda x: x[1], reverse=True)

    # Get the scores of the 10 most similar movies
    sim_scores = sim_scores[1:11]

    # Get the movie indices
    movie_indices = [i[0] for i in sim_scores]

    # Return the top 10 most similar movies
    return df2['title'].iloc[movie_indices]

get_recommendations('The Dark Knight Rises')

get_recommendations('The Avengers')

